import React, { useEffect, useState, useRef } from 'react';
import './Landing.css';

// Check if Leaflet is available
let L;
try {
  L = require('leaflet');
  require('leaflet/dist/leaflet.css');
} catch (error) {
  console.error('Error loading Leaflet:', error);
}

// your React component code here

const Landing = () => {
    const [searchAddress, setSearchAddress] = useState('');
    const [currentMarker, setCurrentMarker] = useState(null);
    const [clickedAddress, setClickedAddress] = useState('');
    const [isSearching, setIsSearching] = useState(false);
    const [searchError, setSearchError] = useState('');
    const mapRef = useRef(null);
    const markerRef = useRef(null);

    useEffect(() => {
      // Leaflet map setup (runs once after component mounts)
      if (!L) {
        console.error('Leaflet not available');
        return;
      }

      // Check if map div exists
      const mapDiv = document.getElementById('mapdiv');
      if (!mapDiv) {
        console.error('Map div not found');
        return;
      }

      console.log('Initializing map...');

      // Small delay to ensure DOM is ready
      setTimeout(() => {
        try {
          const southWest = L.latLng(1.144, 103.535);
          const northEast = L.latLng(1.494, 104.502);
          const maxBounds = L.latLngBounds(southWest, northEast);

          const map = L.map('mapdiv', {
            center: L.latLng(1.2868108, 103.8545349),
            zoom: 16,
          });

          console.log('Map initialized successfully:', map);
          console.log('Map center:', map.getCenter());
          console.log('Map zoom:', map.getZoom());
          console.log('Map has click method:', typeof map.on === 'function');
          console.log('Map is clickable:', map.hasEventListeners ? 'Yes' : 'Unknown');
          mapRef.current = map;
          map.setMaxBounds(maxBounds);

          const basemap = L.tileLayer('https://www.onemap.gov.sg/maps/tiles/Default/{z}/{x}/{y}.png', {
            detectRetina: true,
            maxZoom: 19,
            minZoom: 11,
            attribution:
              '<img src="https://www.onemap.gov.sg/web-assets/images/logo/om_logo.png" style="height:20px;width:20px;"/>&nbsp;<a href="https://www.onemap.gov.sg/" target="_blank" rel="noopener noreferrer">OneMap</a>&nbsp;&copy;&nbsp;contributors&nbsp;&#124;&nbsp;<a href="https://www.sla.gov.sg/" target="_blank" rel="noopener noreferrer">Singapore Land Authority</a>',
          });

          basemap.addTo(map);

          // Add click event to map
          console.log('Adding click event to map...');

          // First add a simple click handler to test basic functionality
          map.on('click', (e) => {
            console.log('=== BASIC MAP CLICK EVENT TRIGGERED ===');
            const { lat, lng } = e.latlng;
            console.log('Basic click at:', lat, lng);

            // Add a simple marker immediately
            const simpleMarker = L.marker([lat, lng]).addTo(map);
            simpleMarker.bindPopup(`<b>Click Test:</b><br>Lat: ${lat.toFixed(6)}<br>Lng: ${lng.toFixed(6)}`).openPopup();

            // Remove this test marker after 3 seconds
            setTimeout(() => {
              map.removeLayer(simpleMarker);
            }, 3000);
          });

          // Now add the full click handler with address lookup
          map.on('click', async (e) => {
            console.log('=== FULL MAP CLICK EVENT TRIGGERED ===');
            const { lat, lng } = e.latlng;
            console.log('Full click at:', lat, lng);

            // Remove previous marker if exists
            if (markerRef.current) {
              map.removeLayer(markerRef.current);
            }

            // Add new marker
            const marker = L.marker([lat, lng]).addTo(map);
            markerRef.current = marker;

            // Get address from coordinates using reverse geocoding
            try {
              console.log('Clicking map at:', lat, lng);

              let address;

              // Try OneMap first
              try {
                const response = await fetch(
                  `https://developers.onemap.sg/commonapi/revgeocode?location=${lat},${lng}&buffer=100&addressType=S&otherFeatures=true`
                );

                if (response.ok) {
                  const data = await response.json();
                  console.log('OneMap reverse geocoding response:', data);

                  if (data.results && data.results.length > 0) {
                    address = data.results[0].ADDRESS;
                  }
                }
              } catch (error) {
                console.log('OneMap reverse geocoding failed, trying OpenStreetMap...');
              }

              // Fallback to OpenStreetMap if OneMap fails
              if (!address) {
                try {
                  const response = await fetch(
                    `https://nominatim.openstreetmap.org/reverse?lat=${lat}&lon=${lng}&format=json`
                  );
                  const data = await response.json();
                  console.log('OpenStreetMap reverse geocoding response:', data);
                  address = data.display_name;
                } catch (error) {
                  console.log('OpenStreetMap reverse geocoding also failed');
                }
              }

              if (address) {
                setClickedAddress(address);
                setSearchAddress(address); // Update search input with clicked address

                // Show popup with address
                marker.bindPopup(`<b>Address:</b><br>${address}`).openPopup();
              } else {
                const fallbackAddress = `Lat: ${lat.toFixed(6)}, Lng: ${lng.toFixed(6)}`;
                setClickedAddress(fallbackAddress);
                setSearchAddress(fallbackAddress);
                marker.bindPopup(`<b>Coordinates:</b><br>${fallbackAddress}`).openPopup();
              }
            } catch (error) {
              console.error('Error getting address:', error);
              const fallbackAddress = `Lat: ${lat.toFixed(6)}, Lng: ${lng.toFixed(6)}`;
              setClickedAddress(fallbackAddress);
              setSearchAddress(fallbackAddress);
              marker.bindPopup(`<b>Coordinates:</b><br>${fallbackAddress}`).openPopup();
            }
          });

          // Cleanup map on unmount
          return () => {
            map.remove();
          };
        } catch (error) {
          console.error('Error initializing map:', error);
        }
      }, 100); // 100ms delay
    }, []);

    // Function to search address and show on map
    const handleSearchAddress = async () => {
      console.log('Search function called with:', searchAddress);
      console.log('Map ref available:', !!mapRef.current);

      if (!searchAddress.trim()) {
        console.log('Search address is empty');
        return;
      }

      if (!mapRef.current) {
        console.error('Map not initialized yet');
        setSearchError('Map not ready. Please wait a moment and try again.');
        return;
      }

      setIsSearching(true);
      setSearchError('');
      setClickedAddress(''); // Clear any previously clicked address

      // Remove any existing marker when starting a new search
      if (markerRef.current && mapRef.current) {
        mapRef.current.removeLayer(markerRef.current);
        markerRef.current = null;
      }

      try {
        console.log('Searching for address:', searchAddress);

        // Try multiple geocoding services as fallback
        let response, data;

        // First try OneMap Singapore with commercial/industrial focus
        try {
          response = await fetch(
            `https://developers.onemap.sg/commonapi/search?searchVal=${encodeURIComponent(searchAddress)}&returnGeom=Y&getAddrDetails=Y&pageNum=1&addressType=S&otherFeatures=true`
          );
          data = await response.json();
        } catch (error) {
          console.log('OneMap failed, trying OpenStreetMap...');
          // Fallback to OpenStreetMap Nominatim with commercial focus
          response = await fetch(
            `https://nominatim.openstreetmap.org/search?q=${encodeURIComponent(searchAddress + ', commercial, Singapore')}&format=json&limit=5`
          );
          data = await response.json();
        }
        console.log('Search response:', data);

        // Handle both OneMap and OpenStreetMap response formats
        let lat, lng, address;

        if (data.results && data.results.length > 0) {
          // OneMap format
          const result = data.results[0];
          lat = parseFloat(result.LATITUDE);
          lng = parseFloat(result.LONGITUDE);
          address = result.ADDRESS;
        } else if (data.length > 0) {
          // OpenStreetMap format
          const result = data[0];
          lat = parseFloat(result.lat);
          lng = parseFloat(result.lon);
          address = result.display_name;
        }

        if (lat && lng && address) {
          console.log('Found coordinates:', lat, lng, 'for address:', address);

          // Remove previous marker if exists
          if (markerRef.current) {
            mapRef.current.removeLayer(markerRef.current);
          }

          // Add new marker
          const marker = L.marker([lat, lng]).addTo(mapRef.current);
          markerRef.current = marker;

          // Center map on the found location
          mapRef.current.setView([lat, lng], 18);

          // Show popup with address
          marker.bindPopup(`<b>Found Address:</b><br>${address}`).openPopup();

          setClickedAddress(address);
          // Don't clear search input - keep it for reference
        } else {
          setSearchError('Address not found. Please try a different search term.');
        }
      } catch (error) {
        console.error('Error searching address:', error);
        setSearchError(`Error searching address: ${error.message}`);
      } finally {
        setIsSearching(false);
      }
    };

    // Function to handle Enter key press
    const handleKeyPress = (e) => {
      if (e.key === 'Enter') {
        handleSearchAddress();
      }
    };

    return (
      <>
        {/* Meta and CSS are normally in public/index.html for React apps */}
        <nav className="navbar">
          <div className="navbar-container">
            <div className="navbar-logo">
              <img src="http://localhost:3845/assets/0b020b3c596ade443a0b22760a015f73ecdd10df.png" alt="valuez logo" className="logo-img" />
              <span className="logo-text">valuez</span>
            </div>
            <ul className="navbar-menu">
              <li><a href="#home">Home</a></li>
              <li><a href="#intro">Introduction</a></li>
              <li><a href="/how-it-works">See How it Works</a></li>
              <li><a href="#plans">Subscription Plans</a></li>
              <li><a href="#faq">FAQ</a></li>
              <li><a href="#reviews">Reviews</a></li>
            </ul>
            <div className="navbar-actions">
              <a href="/login" className="btn btn-primary">Login / Register</a>
            </div>
          </div>
        </nav>

        <section id="home" className="hero hero-bg" style={{ '--hero-bg': "url('http://localhost:3845/assets/0a19d89a3f7bfe891b3b4cde9be9a7bccb493ed3.png')" }}>
          <div className="hero-content">
            <h1 className="hero-title">Smarter Property Insights. Backed by Data.</h1>
            <p className="hero-subtitle">Unlock Accurate Property Value  Instantly.</p>
            <div className="hero-actions">
              <a href="/login" className="btn btn-primary">Login to get Started</a>
              <a href="/how-it-works" className="btn btn-secondary">See How it Works</a>
            </div>
          </div>
        </section>

        <section className="explore" id="intro">
          <h2 className="section-title">Explore Automated Valuations</h2>
          <p className="section-subtitle">Estimate the value of your property now</p>
          <div className="explore-types">
            <div className="type-pill">
              <img src="http://localhost:3845/assets/1f2c5cefac5c3b843f4e0ea23b4d6916bfbd2857.svg" alt="Commercial" />
              <span>Commercial</span>
            </div>
            <div className="type-pill">
              <img src="http://localhost:3845/assets/a6a567e6434a0a9b58b53865a5cf0064ee43d31b.svg" alt="Industrial" />
              <span>Industrial</span>
            </div>
          </div>
          <div className="explore-grid">
            <div className="explore-form">
              <div className="form-row">
                <label>Address Search</label>
                <div className="search-container">
                  <input
                    type="text"
                    className="search-input"
                    placeholder="Enter Commercial/Industrial Property Address"
                    value={searchAddress}
                    onChange={(e) => {
                      setSearchAddress(e.target.value);
                      if (e.target.value === '') {
                        setSearchError('');
                        setClickedAddress(''); // Clear selected location when search is cleared
                        // Remove marker from map whenn search is cleared
                        if (markerRef.current && mapRef.current) {
                          mapRef.current.removeLayer(markerRef.current);
                          markerRef.current = null;
                        }
                      }
                    }}
                    onKeyPress={handleKeyPress}
                    disabled={isSearching}
                  />
                  <button 
                    className="search-btn" 
                    onClick={handleSearchAddress}
                    type="button"
                    disabled={isSearching || !searchAddress.trim()}
                  >
                    {isSearching ? 'Searching...' : 'Search'}
                  </button>
                </div>
                {searchError && (
                  <div className="search-error">
                    {searchError}
                  </div>
                )}
              </div>
              {clickedAddress && (
                <div className="form-row">
                  <label>Selected Location</label>
                  <div className="selected-address">
                    {clickedAddress}
                  </div>
                </div>
              )}
              <div className="form-row two-cols">
                <div>
                  <label>Property Type</label>
                  <div className="input like-input">Select Property Type</div>
                </div>
                <div>
                  <label>Floor Area</label>
                  <div className="input like-input">Enter Floor Area</div>
                </div>
              </div>
              <div className="form-row">
                <button className="btn btn-primary">Predict Price</button>
                <div className="hint">Sign in to view full prediction and data insights.</div>
              </div>
            </div>
            <div className="explore-image">
              <div id="mapdiv" style={{ height: '400px' }}></div>
              <div className="map-instructions">
                <p> Click anywhere on the map to get the address, or search for an address above</p>
              </div>
              <div className="map-debug">
                <button 
                  type="button" 
                  className="debug-btn"
                  onClick={() => {
                    console.log('Map ref:', mapRef.current);
                    console.log('Marker ref:', markerRef.current);
                    console.log('Current search address:', searchAddress);
                    console.log('Current clicked address:', clickedAddress);
                  }}
                >
                  Debug Map State
                </button>
                <button 
                  type="button" 
                  className="debug-btn"
                  style={{ marginLeft: '0.5rem' }}
                  onClick={() => {
                    if (mapRef.current) {
                      // Test map functionality without API calls
                      const testLat = 1.2868108;
                      const testLng = 103.8545349;
                      const testAddress = 'Test Location (Orchard Road area)';

                      // Remove previous marker if exists
                      if (markerRef.current) {
                        mapRef.current.removeLayer(markerRef.current);
                      }

                      // Add test marker
                      const marker = L.marker([testLat, testLng]).addTo(mapRef.current);
                      markerRef.current = marker;

                      // Center map on test location
                      mapRef.current.setView([testLat, testLng], 18);

                      // Show popup
                      marker.bindPopup(`<b>Test Address:</b><br>${testAddress}`).openPopup();

                      setClickedAddress(testAddress);
                      setSearchAddress(testAddress);

                      console.log('Test marker added successfully');
                    }
                  }}
                >
                  Test Map (No API)
                </button>
              </div>
            </div>
          </div>
        </section>

        <section className="features" id="how">
          <h2 className="section-title">How it Works</h2>
          <div className="features-grid">
            <div className="feature">
              <h3>Provide Details</h3>
              <p>Enter property type, location, size, and lease information.</p>
              <img src="http://localhost:3845/assets/331a621a40fb7410ec5f4545049780e403050962.svg" alt="Step icon" />
            </div>
            <div className="feature">
              <h3>Analysis</h3>
              <p>Our model analyzes market data in real-time.</p>
              <img src="http://localhost:3845/assets/03031496906ca8653fe683d68d298574db04404d.svg" alt="Analysis icon" />
            </div>
            <div className="feature">
              <h3>Get Your Valuation</h3>
              <p>Instant estimate with key drivers and a price range.</p>
              <img src="http://localhost:3845/assets/e287745e5359ba0fa2052cc098b64513057b7de5.svg" alt="Valuation icon" />
            </div>
          </div>
        </section>

        <section className="items">
          <h2 className="section-title">Everything you need. Nothing you dont.</h2>
          <div className="items-list">
            <div className="item">
              <img src="http://localhost:3845/assets/b2e18d059740ed56dc92102190a324a85c34b88c.svg" alt="Accessibility" />
              <h4>Accessibility first</h4>
              <p>Fully WCAG 2.0 compliment, made with best a11y practices</p>
            </div>
            <div className="item">
              <img src="http://localhost:3845/assets/9939cb59cdc6a5a982c788b97140e3346890ba80.svg" alt="Responsive" />
              <h4>Responsive design</h4>
              <p>Looks and works great on any device and screen size</p>
            </div>
            <div className="item">
              <img src="http://localhost:3845/assets/4574075b610d2b0fdff60e94d1899f4e08a17f28.svg" alt="Light/Dark Mode" />
              <h4>Light and dark mode</h4>
              <p>Seamless switching between color schemes, 6 themes included</p>
            </div>
            <div className="item">
              <img src="http://localhost:3845/assets/7d51514c08a17a6cadc7b57d26b1902d853581ed.svg" alt="Customizable" />
              <h4>Easy to customize</h4>
              <p>Flexible options to match your product or brand</p>
            </div>
            <div className="item">
              <img src="http://localhost:3845/assets/81ec8c4c3ebdd76e61088fe884e45d077ba52316.svg" alt="Performance" />
              <h4>Top-level performance</h4>
              <p>Made for lightning-fast load times and smooth interactions</p>
            </div>
            <div className="item">
              <img src="http://localhost:3845/assets/d2bc75a64f53edba1d21d095b0e53fca43d661a0.svg" alt="Support" />
              <h4>Outstanding support</h4>
              <p>24/7 dedicated team, always ready to assist</p>
            </div>
          </div>
        </section>

        <section className="pricing" id="plans">
          <h2 className="section-title">Subscription Plans</h2>
          <div className="pricing-table">
            <div className="pricing-card">
              <h3>Basic</h3>
              <p className="price">Free</p>
              <ul>
                <li>Estimate for 1 property</li>
                <li>Basic data insights</li>
                <li>Email support</li>
              </ul>
              <button className="btn btn-primary">Get Started</button>
            </div>
            <div className="pricing-card">
              <h3>Standard</h3>
              <p className="price">$29 / month</p>
              <ul>
                <li>Estimate up to 10 properties</li>
                <li>Detailed data insights</li>
                <li>Priority email support</li>
              </ul>
              <button className="btn btn-primary">Subscribe</button>
            </div>
            <div className="pricing-card">
              <h3>Premium</h3>
              <p className="price">$99 / month</p>
              <ul>
                <li>Unlimited property estimates</li>
                <li>Full data access and export</li>
                <li>Phone & email support</li>
              </ul>
              <button className="btn btn-primary">Subscribe</button>
            </div>
          </div>
        </section>

        <section className="faq" id="faq">
          <h2 className="section-title">Frequently Asked Questions</h2>
          <div className="faq-item">
            <h3>How accurate are the valuations?</h3>
            <p>Our valuations use advanced data analysis and real-time market info to provide the best estimates.</p>
          </div>
          <div className="faq-item">
            <h3>Can I use this for residential properties?</h3>
            <p>Currently, we support commercial and industrial properties only.</p>
          </div>
          <div className="faq-item">
            <h3>Is my data safe?</h3>
            <p>Yes, we follow strict data privacy and security protocols.</p>
          </div>
        </section>

        <section className="reviews" id="reviews">
          <h2 className="section-title">User Reviews</h2>
          <div className="review-item">
            <p>"Valuez helped me quickly estimate my office space value with great confidence!"</p>
            <strong>- Alex T.</strong>
          </div>
          <div className="review-item">
            <p>"The platform is intuitive and the data insights are very helpful."</p>
            <strong>- Priya S.</strong>
          </div>
        </section>

        <footer>
          <div className="footer-content">
            <div className="footer-logo">
              <img src="http://localhost:3845/assets/0b020b3c596ade443a0b22760a015f73ecdd10df.png" alt="valuez logo" />
              <span>valuez</span>
            </div>
            <ul className="footer-menu">
              <li><a href="#home">Home</a></li>
              <li><a href="#intro">Introduction</a></li>
              <li><a href="#how">How it Works</a></li>
              <li><a href="#plans">Subscription Plans</a></li>
              <li><a href="#faq">FAQ</a></li>
              <li><a href="#reviews">Reviews</a></li>
            </ul>
            <p className="copyright">&copy; 2024 Valuez Inc. All rights reserved.</p>
          </div>
        </footer>
      </>
    );
  };

  export default Landing;
